/*
3. 无重复字符的最长子串
  难度  中等
  给定一个字符串，请你找出其中不含有重复字符的 最长子串 的长度。
  示例 1:
  输入: "abcabcbb"
  输出: 3
  解释: 因为无重复字符的最长子串是 "abc"，所以其长度为 3。
  示例 2:
  输入: "bbbbb"
  输出: 1
  解释: 因为无重复字符的最长子串是 "b"，所以其长度为 1。
  示例 3:
  输入: "pwwkew"
  输出: 3
  解释: 因为无重复字符的最长子串是 "wke"，所以其长度为 3。
       请注意，你的答案必须是 子串 的长度，"pwke" 是一个子序列，不是子串。
  通过次数650,153提交次数1,827,186
 * @param {string} s
 * @return {number}
 * https://leetcode-cn.com/problems/longest-substring-without-repeating-characters/description/
 * 方法一 要判断是否重复，就要查找是否已遍历该字符，适合用hash结构。
 * 使用一个hash结构保存字符的下标。下一次遇到该字符，那么就可以得到该字符之间的字符个数。
 * 中间过程可能有其他字符重复了，所以还需要比较
 */
var lengthOfLongestSubstring = function(s) {
 	let dict = new Map()
	let begin = 0
	let max = 0
    let index = 0
	for(let j = 0;j<s.length;j++){
		index = dict.get(s[j])
		if(index!=null && index>=begin){
            max = Math.max(max,j-begin)
            begin = index+1
		}
		dict.set(s[j],j)
	} 
	max = Math.max(max,s.length-begin)
	return max
}
//尾递归优化函数，将尾递归转换成循环，防止栈溢出。
function tco(f) {
    let value
    let active = false
    let accumulated = []
    return function accumulator() {
        accumulated.push(arguments)
        if(!active) {
            active = true
            while(accumulated.length) {
                value = f.apply(this, accumulated.shift())
            }
            active = false
            return value
        }
    }
}
//方法二 大字符串的场景执行半天后栈溢出了。
//接收一个字符数组，返回其无重复字符的最长子数组
const f1 = chs =>{
    if(chs.length<2)return chs
    //not contains chs[0]
    const chs1 = f1(chs.slice(1))
    //console.info(`${chs}=>${chs1}`)
    //contains chs[0]
    const chs2 = f3([],chs)
    //console.info(`${chs}=>${chs2}`)
    if(chs1.length>chs2.length){
        return chs1
    }
    return chs2
}
//接收一个字符数组，其第一个元素是无重复字符的最长子数组的第一个元素。acc变量是一个累积器，用于将递归改为尾递归。
const f2 = (acc,chs) =>{
    if(chs.length==0)return acc
    const [head,...tail] = chs
    const i = tail.indexOf(head)
    if(i<0){
        return f2(acc.concat([head]),tail)
    }
    return f2(acc.concat([head]),tail.slice(0,i))
}
const f3 = tco(f2)
